import React from "react";
import classes from "./Logo.module.css";

const logo = (props) => (
  <div className={classes.Logo}>
    <img
      alt=""
      src="https://www.kindpng.com/picc/m/38-387166_burger-clipart-logo-design-png-burger-logo-design.png"
    />
  </div>
);

export default logo;
